    render(){
        return(
            <LoadScript googleMapsApiKey="AIzaSyBp3yj-pQJb3wB9RfdJ4VTKkjMhvDPxuBg"> 
                <GoogleMap
                    mapContainerStyle={ {length: "300px", height: "300px"} }
                    zoom={19}
                    center={ { lat: 48.851913, lng: 2.286672 } }>

                    <Marker 
                        position={{ lat: 48.851913, lng: 2.286672 }} 
                        label="18/12"/>

                </GoogleMap>
            </LoadScript>
        );
    }
}
